"rating":"4.5",
"reviewcomment":"I love good sandwich and Deli Board definitely delivers!<br><br>Where Ike&#39;s is all about the sauce, deli board is all about the meat, and man do they give you a lot of meat!<br><br>I&#39;ve tried a few different sandwiches here recently. The Ron is pretty good, it&#39;s essentially a good cheese steak with TONs of meat plus some avocado. <br><br>The real winner here though (of the ones I&#39;ve tried so far) is the &#34;$$$&#34; - pronounced &#34;money&#34; by the lady who handed me the sandwich. Really delicious warm and gooey with TONS of flavor and meaty goodness! It contains brisket, corned beef, kosher salami, muenster cheese, cheddar cheese, cherry peppers, cole slaw, Board sauce all on a warm french roll. A delicious combination!<br><br>Be warned that you may have to wait, especially on a weekday lunch, but Deli Board is definitely worth the wait.",
