"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/8j18OhZOi7gEt1ahFYOd2g/l.jpg",
"rating":"4.5",
"reviewcomment":"This is a thoroughly delightful little spot to grab a really yummy sandwich - no fanfare, no mentions of grass-fed-well-massaged-happy-go-lucky-meats, just super tasty, well-executed sandwiches.<br><br>As promised in other reviews, the lady running the show is so friendly and sweet, you kind of want to cancel your day and stay to eat more sandwiches. This wouldn&#39;t be a bad thing, either, because the turkey melt with avocado, mayo, mustard (x 2) and cranberry sauce on Dutch bread was simply delicious. The kind of delicious where your lover calls you while you&#39;re eating it, and you don&#39;t pick up the phone.<br><br>I will be going back regularly to try the other options, as everything looked so authentic and yummy.<br><br>Pro tip - take the time to sit down and eat outside the shop or somewhere nearby, so you can do this sandwich justice by eating it fresh. I grabbed one to go while on a walk and by the time I got home, a bit of sogginess had occurred. 100% my fault for not jumping on the sandwich straight away. I&#39;m sorry, turkey melt; next time I&#39;ll do right by you.",
