"rating":"4.5",
"reviewcomment":"Wanted to take a friend somewhere special and yummy for his birthday and this has been one of the spots I wanted to try. You would think that French cuisine is super pricey, but this wasn&#39;t as pricey as most. I was definitely not disappointed in this place at all. <br><br>First, the staff here is super friendly and helpful in helping you choose dishes.<br>Second, the food didn&#39;t take that long to arrive at your table.<br>Third, the food is exquisite and had a good portion of each<br>Fourth, the price is totally worth it and doesn&#39;t hurt your wallet as much as I would think. <br><br>My table we ordered the trio salmon, which melted in my mouth and the duck which wasn&#39;t dry at all. Next,we ordered the bouillabaisse which was the perfect portion of each seafood. The bread definitely added to the finishing touch for the soup. My friend ordered the duck, which was moist and delicious. For desserts, we ordered the French toast which was different than the breakfast French toast and super creamy with that yummy hazelnut cream. I ordered the chocolate rum cake which was perfect with the rum raisin ice cream. <br><br>Everything was just perfect for the price. The place gets crowded and can get a little tight with tables close by, but honestly it did not bug me. Just be sure to make a reservation in advance. I got even lucky booking it 3 weeks I&#39;m advance with few slots!",
