"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/FFCsR4fGQEHtwitMo2YyYw/l.jpg",
"rating":"4.5",
"reviewcomment":"Let it be known that I&#39;ve never been to Bacon Dog Cart sober.  Each and every time I&#39;ve gone, i&#39;ve been under the influence of alcohol, most of the time it&#39;s just a little.  With that said, the Bacon Dog Cart is now a staple every time I go out with friends in the Mission.  <br><br>You have a hot dog, wrapped in bacon, topped off with peppers and onions, and mayo (no ketchup or mustard gotta go with the mayo).  Seemingly simple, yet greatness is achieved through the combination of these ingredients.  This isn&#39;t just a &#34;bacon makes everything better&#34; situation, but rather a tricky orchestration of 4 parts to produce a wonderfully made late night snack.  The bacon wrapped hot dog is one of those things, when conditions are met, get an extra half a star in my book.  In this case, its gotta be late night and you gotta have some alcohol in you to fully enjoy the bacon wrapped cart. 100% of the time, it works every time",
