"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/43burxWv_PDuNV4aiZfYqQ/l.jpg",
"rating":"4.5",
"reviewcomment":"A cute place! Compared to Suppenküche, this place was less busy and less noisy with better food. I&#39;ve only had beer at this place, and not at Suppenküche, so I can&#39;t compare them on that point. <br><br>Beer - my friends got one of the specials in a 2 liter boot. It was expensive ($20 per liter) and not quite my cup of tea (or boot of beer?). I on the other hand, got a hefewizen on the regular menu ($5.75 for 1/3 liter) and loved it. <br><br>Pork cheek (special) - loved it! Tender, marinated perfectly, served with noodles (seemed like they were spaetzles). Only wished there were more of the noodles - so chewy and yummy! <br><br>Wienerschnitzel - nom nom nom. Thinly sliced meat with thin crust, fried to perfection. I thought it was great! <br><br>We also got two other dishes - one chicken and another that I don&#39;t remember. Both of them were yummy. We also got two dessert dishes - an apple strudel and a jam cookie (?). Both were not too sweet and well executed in general.               <br><br>All in all, I would go back to this place any time I feel like having hearty fried food with good beer.",
