"rating":"4.5",
"reviewcomment":"Our first trip to Chinatown ended in a hike up to Henry&#39;s thanks to the reviews here on Yelp. I had a hard time believing a five-star restaurant could be reasonably priced. Boy am I glad we took the chance.<br><br>Our waitress recommended the meat pie to start, and it was excellent. It&#39;s served in four slices that are probably big enough to each be an appetizer alone.<br><br>I always order a house special when I&#39;m at a new restaurant, and at Henry&#39;s those specialties are smoked Hunan-style. I decided to get the Marty&#39;s Special, because I thought it was funny, since my name&#39;s Marty and I don&#39;t see it often.<br><br>The waitress thought I had been here before and said I knew how to order, because the Marty&#39;s Special is fantastic. The chicken in it was good enough but the pork was worth the price alone. Tender and smoky, it was easily the best I&#39;ve had yet.<br><br>We also got the fried rice and the hot and sour chicken, which were both good but didn&#39;t hold a candle next tithe meat pie and the smoked pork. Next time we&#39;ll just get those two and share; it&#39;s plenty for two people.",
