"reviewcomment":"Stop Two in San Francisco? <br><br>The Broken Record - conveniently located 6 blocks from the house where we were staying.  <br><br>When we walked in, I sorta glanced at my friend, wondering if he had been laying on the sarcasm when he talked about how good the food was... and then... <br><br>The &#34;pork wings&#34;, which I believe we ordered three times in three visits, were approximately the size of an entire baby pig, and so unbelievably tender that you could gently slide the entire piece of meat off of the bone without even trying.  It takes a really noteworthy amount of talent to make any kind of wing that well, and these guys and gals get it done.  <br><br>The macaroni and cheese was also absurdly delicious and rich and just in case you dont think three pounds of delicious cheese isn&#39;t rich enough, you get pulled pork with it too...  Awesome... friggin&#39; awesome.  <br><br>I definitely had breakfast here once too, and I&#39;m 80-90% sure I had eggs benedict or something of that nature - I know it was delicious - I just have such vivid memories of the pork wings that the rest is a little bit hazy.  <br><br>All things considered, I&#39;m really glad I don&#39;t live 6 blocks from this bar because I would live there.  Forever.",
