"ogurl":"http://www.yelp.com/biz/tonys-pizza-napoletana-san-francisco",
"categorystrlist":"Pizza,Italian",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/47wDQAulJ4A8fvPrVaI4QA/l.jpg",
"rating":"4.0",
"reviewcomment":"Tony and his staff are possibly evil geniuses. I grew up eating good pizza on the East Coast in NYC, Boston, NJ and New Haven. This has warped my view of what I deem as good, or edible pizza. So far, this place is one of two places in California that has pleased me. The owner is friendly, informative and from NYC. And he knew all the great place in New Haven. This place has some of that California styles pizza options available without compromising it&#39;s New York roots in what arguably has to have been my best ever pizza experience.<br><br>The margareta pizza, 2013 worlds best pizza winner is a crowd pleaser. Delicious, perfect, elegant and everything you would want in a margareta style pizza. They have a pizza called the New Yorker, 2013 best pizza in the US. It&#39;s coal fired, meaty, with homemade sausage and so delicious. <br><br>The owner knowing my New Haven root even offered to get the edges a &#34;little extra charred&#34; as would be common in New Haven. They did so, without burning the bottom which impressed me, or overcooking it. Yes, charring on food is bad for you... Dude, this is Pizza not Salad, get over yourself.<br><br>This place also features a good wine list, decent bar and tap list. Helpful staff, nice ambiance, a little pricey but cheaper than the Pizza Factory (a place that disappointed me).<br><br>Important this place is busy, book reserations ahead, order as take away(out) or don&#39;t be shocked to have to wait forever on a Saturday night for seating. Turn around time for the food is fair, seating time can be less than desirable. It is however worth the wait, and likely the best pizza without question on the entire west coast. <br><br>This is unless your a Chicago pizza fanatic. if so, please go back on a plane to your frozen tundra to eat your loaf of bread with ketchup and continue to think, misguided as you as it would be that somehow that is pizza. Really? I weep for you, I don&#39;t understand how Chicago style is considered pizza.",
