"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/4nPxU5GfTx72u4FewxlhIg/l.jpg",
"rating":"4.5",
"reviewcomment":"UNBELIEVABLE EXPERIENCE!  Alex (The owner) obviously cares about his business, because it reflects on the staff, the service, the ambiance and most importantly the quality of the food.  <br><br>Our friend made our reservation and something had slipped her mind while doing so...the fact that we have our 11 month old baby.  I called the restaurant to speak with someone to see if they can accommodate us with a child in such a nice place.  Alex (the owner) answered and understood the reason for my call and was also a pleasure to speak with as well.<br><br>They have one high chair for such an event and we are fortunate that our daughter is pretty good in restaurants and we are (or were) frequent diners ourselves, so we understand and respect the fact that enjoying such a nice place can be hindered by a crying or screaming baby.  We get that.<br><br>Alex gave us a table by the window to accommodate the high chair and made sure we were comfortable.  Mike and William were our servers and they were extremely knowledgeable and courteous to us all. They were extremely sharp with detail and also their presentation of themselves while being very professional as well. <br><br>The food?...Are you kidding me?!  I tried the following and every bite was delectable and just the right amount.  <br><br>-Ramini&#39;s Tomales Bay Buffalo Mozzarella<br>-County Line Mixed Baby Lettuces<br>-Kale Tagliatelle<br>-Market Fish (Sea Bass)<br>-Braised Sonoma Lamb Shank<br><br>They offer a complimentary sardine bite that I could have eaten an entire full size plate of because it was amazing as well.  <br><br>Let&#39;s just simply put it as this...<br><br>If you are looking for a ultimate and quintessential San Francisco dining experience, look no further.  The experience will leave you asking just one question upon leaving...&#34;When are we coming back?&#34;<br><br>Thank you Alex, Mike and William...you really made our experience a great memory.",
