"rating":"4.5",
"reviewcomment":"The minute I bit into my Classic Tarte Flambée - it was love at first bite.  It came to no surprise to learn that esteemed owner Alex holds two Masters Degrees and comes from generations of master cooks passed down from his family, along with his pedigreed partners, Scott and Shane, a concoction mix of intellectual passions!  What a great team! APPLAUSE, APPLAUSE!<br><br>Their uniquely and well thought of dishes, reminded me of a high noon tea experience during my stay at The Peninsula Hong Kong, San Franciscan style!  First glance at their menu, WOW!,  Everything looked scrumptious!!  Thankfully, I had my trusted YELP mobile and bookmarked this place many thanks to Elite YELP friend &#34;Maria M.&#39;s&#34; recommendations from her recent visits here which left ordering, a breeze!<br><br>-- (1) Do try their Classic Tarte Flambée prepared with Bacon, caramelized Onion, Cheese, Chives and Crème Fraîche.  A must try and no is not an option. It is light and crispy and will melt in your mouth.  It left my highly opinionated BFF speechless!  That is correct, speechless.!! :p<br><br>-- (2) Their Croque Josephine - Croque Napoleon topped with One Poached Egg left me wanting more!!  Their organic house salad was just excellent.<br><br>-- ( 3) Their Chocolate Hazelnut Tartufo - A heart of dark chocolate ganache surrounded by velvety hazelnut gelato, and coated with hazelnut praline and meringue was just fantastic.  And of course, it wouldn&#39;t be complete without my cappuccino which did not disappoint!<br><br>Customer service was FIRST IN CLASS that would put The Hong Kong Peninsula a run for their money.  We cannot wait to come back for more for an exploration of their menu over and over again.  Our next on the list to try will be their Artisanal Salumi Plate and their Smoke Salmon.  I will leave the dessert for a surprise for the next visit!<br><br>Noeteca is a very pet friendly place and provides a cool water bowl for your pooch.  It is casual yet sophisticated and when it gets down to your palate, OUTSTANDING!<br><br>Cheers! :p",
