"rating":"4.0",
"reviewcomment":"My first love in life is my husband.  My second is my family.  Third is Tommaso&#39;s!  In a city full of amazing food, this place is a true gem!<br>The line can be out the door crazy, so we either show up right as it opens or an hour before it closes.  If there is a wait, they allow you to order a glass of wine and enjoy your pre-meal experience a little more!<br>The service is always great!  From the hostess to whoever is doing the serving!  Never have I walked away thinking someone could have done  a better job.  The cooks are super fast as I think the most we have ever waited after ordering food is 15 minutes!<br>Now to the food!  Amazing.  Period.  We always get a few dishes and share.  Our favorites are the spinach and parm pizza along with the chicken parm!  But, from the drinks to the food, everything there has been great!  Get the house syrah!  The complimentary bread is fresh and delish!  The prices are really reasonable for being in the city and for the portion sizes.  <br>Love this place, can&#39;t say enough!",
