"rating":"4.0",
"reviewcomment":"If you&#39;ve never been to this show in San Francisco you missed out! The tent itself at the Pier stood out to get your attention. So there&#39;s no excuse not to have seen this show! Spectacular! Awesome! Fun! And so unique! The performers were all perfect in their own way. This was a 5 course dinner and a show and I was so satisfied at the end of the night. My b.f. was also very happy. The service was pretty good too. The only complaint we had was where we were seated. There were these big beams that were holding up the tent and we got stuck slightly  right in front of one of them. You can choose to sit right in the mix with the performers but prepare to be part of the show. The comedians WILL be making fun of you no matter what. We had a blast though. This tent can only hold about 100 to maybe 150 people so there&#39;s not that much room. But you won&#39;t even notice because the show is SO GREAT! We wanna go again once they settle down in their new location.",
