"reviewcomment":"I think this place used to be called Fil-Am BBQ, or maybe I just thought that because BBQ is all I order from here. I&#39;m sure all the other Filipino dishes are delicious as well, but the BBQ is what I come for! Those BBQ pork and chicken skewers are amazing! If you can&#39;t decide what to order here for some reason, get those! They pack the sticks so full of huge chunks of delicious meat for less than $2 each. So awesome.<br><br>This restaurant is a hole-in-the-wall and I&#39;m sure you&#39;ll smell it before you see it. They probably get a bunch of customers from that waft of mouthwatering BBQ scent alone. I think most people order take-out because the place is pretty small, but there is some space inside to dine in if you want to.",
