"reviewcomment":"This place sounds like an animal name from a cat and dog adventure movie, and I&#39;m pretty sure it&#39;s cause you&#39;ll feel Homeward Bound <a href='/redir?url=http%3A%2F%2Fwww.imdb.com%2Ftitle%2Ftt0107131%2F&amp;s=5f12ea2d1cea8850ec6d02ae96878e45253fd3426a1fb91c467f9811118dd831' target='_blank' rel='nofollow'>imdb.com/title/tt0107131</a> before you even order an appetizer. The inside is like a grander version of your grandma&#39;s house and has some of the better service in San Franciso I&#39;ve ever received. <br><br>Typically known for breakfast, but our group grabbed a reservation for their Tuesday night BYOB policy. They chilled our bottle, brought fresh baked bread, and made us feel super special before even asking for our order. <br><br>Food wise, I had a delicious pasta, but it was oh so overshadowed by a French onion soup that I can&#39;t stop thinking about over a week later. Not a person in our group said anything but mmmmmm and it was super affordable since there wasn&#39;t a corkage. <br><br>Zazie you&#39;re one coooool cat!",
