"rating":"4.5",
"reviewcomment":"I am starting to really love this place. They have amazing drinks (had the holiday margarita the other day and it was super fresh and tasty!) , great food, and comfortable seating! I&#39;ve been here several times since my sweetie lives close by, and they give excellent service! Warm cheesy queso and chips (which is a bowl of melted yummy cheese with bits of jalopeno in it) with lots of chips.<br><br>Today I had the pleasure of eating Brunch here! (only on Sundays) my sweetie and I split the Chilaqules (YUM!) but the dish that we were salivating over the most was the Carnitas hash. Wow, I am still thinking about it. Crisp carnitas with potato, grilled onion and pablano chiles, with two eggs on top. The coffee also has a hint of mexican cinnamon...I almost didn&#39;t yelp about it since I wanted it to be my little secret....but I want them to keep there brunch going! <br><br>It&#39;s super casual, lots of couches (instead of tables, but they do have a few tables) and what can I say, I love this place.",
