"rating":"4.5",
"reviewcomment":"Probably the best sushi I&#39;ve ever put in my mouth!  I came here with two other friends to celebrate my friend&#39;s new job (thanks for treating us Joe!)  The restaurant is small, warm and typical of a SF boutique restaurant--lots of wood accents, painted black ceilings, and exposed incandescent light bulb fixtures.<br><br>But more importantly, the food.  Again, the best sushi I&#39;ve ever sank my teeth into.  We each did the chef&#39;s tasting menu.  16 assorted slices of heaven!  Skip the soy sauce, skip the wasabi, and just enjoy the fish with the light touches of glaze.  Best. Sushi. Ever.<br><br>There can be a wait, but scribe your name on the waiting list, jet across the street to cask house to enjoy a pre-dinner drink.  Saru is well worth the wait!<br><br>Can&#39;t wait to go back to try their chirachi during lunch, until then...go get yourself some delicious sushi at Saru!",
