"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/g8oVt4BqdO8SSBQ7l-ijNA/l.jpg",
"rating":"4.5",
"reviewcomment":"I love chicken burgers and chicken sandwiches and fried chicken and bread and all of these things. You might say I consider myself a chickenoisseur.<br><br>My lords, ladies and gentlemen, I have a serious announcement to make.<br><br>This was the best fried chicken sandwich I&#39;ve ever had in my life.<br><br>FO REALZ.<br><br>Or perhaps I should say &#34;chicken sando&#34;, which I genuinely did not connect with the word sandwich until I asked for it and the guy repeated my order back to me minus the O and plus the WICH. Ahhhh so this is what this exotic &#34;sando&#34; means. Excellent! I&#39;m even more excited.<br><br>We fortunately managed to grab a table; a couple of screens were showing sports (UEFA Champions League on one, ice hockey on the other. Actual ice hockey! On the TV! So American!) but weren&#39;t distracting. What I DID find distracting - in a good way - was the wall plated entirely with car license (look, I spelt &#34;licence&#34; the noun like the verb, just like a native!) plates. I loved looking at these and trying to choose my favourite state design. They&#39;re so cool and colourful that they make a lovely decorative addition.<br><br>Briony C is right - get a paper menu for detail and check your app to find out what people recommend. I personally recommend everything on the menu except the chicken sando because all of those are for me, you can have anything else you like but all the chicken sandos are mine mine mine. I don&#39;t even have the adjectives. I try to formulate &#39;em but they just turn into drool.<br><br>I have a thing that I feel next time I go to San Fran I ought to try places I haven&#39;t tried before... but I will definitely be back at Garaje anyway. Just try and stop me. (No, seriously, if I try to go more than once a day, please actually try and stop me.)",
