"rating":"4.0",
"reviewcomment":"ordered some food here over grub hub with my coworkers, and was very pleasantly surprised. <br><br>Ive always loved sandwiches ALOT! but lately going to places like subway and random sandwich places have been a turn off. most have that slimy, presliced meat that, to me, just doesn&#39;t taste right anymore. i hadn&#39;t eaten a sandwich in quite awhile when one of my coworkers was ordering from AK and asked if i wanted anything. i usually get the same thing on every sandwich i get, no matter where its from. I&#39;m a picky eater, don&#39;t judge me.<br><br>i was a bit disappointed they didn&#39;t have the option for a sourdough roll, but sliced sourdough was just fine. i got turkey with bacon on sourdough, with lettuce, red onions, and mayo. the turkey was amazing! and they put a good amount of bacon which is usually not the case most places. the lettuce and onions were super fresh and there was just enough mayo.<br><br>needless to say it was the best sandwich any of us had had in a long time, and we have already ordered twice more since the first time! and there will be plenty more to come in the future.",
