"reviewcomment":"The. Best. Hash. Browns. Ever!<br>Okay, I admit I secretly love McDonald&#39;s oil-dripping hash browns as much as the next fat kid. But Griddle Fresh&#39;s fresh hash browns are the bomb! Okay, they&#39;re basically the same thing as what you&#39;d get at any other diner, but made into a thinner layer and seasoned. That&#39;s it. That&#39;s the secret guys. But the difference it makes!! It eliminates the unseasoned and unfried bits of poor potato hidden in the middle of an average pile of hash brown. Every tiny strip gets to turn golden brown and crispy, and eaten! No potato left behind. And I didn&#39;t even need ketchup.<br><br>And my side of Smoked Salmon Tartine? Also delicious. Comes with practically one whole avacado on brioche bun.<br><br>On top of that, service was great-I definitely recommend this place!",
