"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/25aV76YsciCHs_9yPWj5tw/l.jpg",
"rating":"4.5",
"reviewcomment":"Wooly Pig, how I miss being close to you.<br><br>For the three months when I worked around the corner from Wooly Pig, I frequented the cafe 1-3 times a week. Even with the plethora of tantalizing restaurants in the neighborhood, Wooly Pig kept me coming back for more. I ate nearly every sandwich on the menu, enjoyed every panna cotta, sipped tea and lemonade, and supped all the soups I could. Each dish and drink is unabashed in its flavor - the ingredients really shine. On top of this, owner Lieng and his staff are just about the nicest people you&#39;ll meet.<br><br>My favorites:<br>+ Bahn Mi - I actually prefer this over the Wooly Pig<br>+ Cream of Shiitake Mushroom soup - I want this in heaven<br>+ Curry Udon Soup - Comforting, like a favorite sweater; note: there was one soup that I thought was a little salty - can&#39;t remember any more if it was this one<br>+ Thai Tea Panna Cotta - Oh so good<br>+ Honey ginger tea - Not for the faint of hearts, as this is super gingery; but if ginger is your thing, definitely get this<br><br>Also delicious:<br>Briny Egg, Mozzarella Pesto, Wooly Pig, Croque Monsieur, Vegi, Almond Panna Cotta, Corn Chowder<br><br>Not as into:<br>~ Kahlua Pulled Pork special - too saucy for me, ended up taking a drop home on my pants...<br><br>Wooly Pig, please come to the South Bay or Peninsula!",
