"rating":"4.0",
"reviewcomment":"Dottie&#39;s is a San Francisco institution. It&#39;s one of the breakfast spots in the city, and as soon as you sit down with your food in front of you, it&#39;s easy to see why.<br><br>Seriously, those 2,000+ reviews do not lie. This is the legit spot for eats.<br><br>I went with a friend on a Friday morning at about 9am. It was packed when we got there, but the line moved quickly (don&#39;t expect the same during the rush hour or during the weekend, then you will wait.) It&#39;s a spot that&#39;s larger than it looks, with tables extending to the back. The menu is simple but amazing, and everything is upped on quality and size. Not just pancaked but blueberry cornmeal pancakes. Not just an omelette but a delux hand crafted omelette with ingredients minced and spread throughout rather than just stuffed into the centre. You get the deal.<br><br>Plus, they have probably the best breakfast deal in the entire city. The Open Road: two eggs, bacon, eggs or sausage, homefries, and two giant pancakes, all for $13. Yes, yes, and more yes, every time. <br><br>Eat here, pass out, enjoy life. This is a true blue spot for sure.",
