"ogurl":"http://www.yelp.com/biz/hanami-brasserie-san-francisco",
"categorystrlist":"Japanese",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/E36mDyv8jngMYqsZ3rSpmQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Service was marvelous!!!<br><br>We walked in with a barely 2 years old child we were babysitting. He was crying and screaming and ohmygoodness, I was hungry! The waiter seated us at the front and probably saw that our kid was going to be a real disturbance to the surrounding customers and offered us a table in the back. Thumbs up for that! There was no customers in the back, but the kid was still making a fuss for a bit. Minutes later, he had quite down after some distractions. The waiter even gave him a ballon to help.<br><br>Now onto the food: <br>- Lotus Blossom - What a great combo! Some crunchiness from the lotus and cucumber &amp; some flavorfulness from the spicy tuna (and probably a mix of other fishes) = LIPSMACKING DELICIOUS!<br><br>- Seaweed Salad - Cute appetizer. Almost tasted the same as anywhere else, but better! It was topped with some &#34;rolled-into-a-flower&#34; daikon.<br><br>- Lunch Sashimi - 9 pieces total + salad + soup. I have to say, the soup and salad could be better than the sashimi itself! The miso soup wasn&#39;t salty, which is a plus! There was a few pieces of spinach and deep fried bean curd (better it was bean curd) in the soup. It&#39;s really good, trust me. You&#39;ll be licking your bowl afterwards. The salad had the best dressing ever! It was light and refreshing. The sashimi (Salmon, Tuna, and one more that I don&#39;t remember) was a pretty thick cut and satisfying. <br><br>- Uni - For $9 = Mouthdrooling. It&#39;s huge!<br><br>- Double Tuna Roll - Spicy tuna on the inside with fresh&amp;grilled tuna on top. Spicy tuna wasn&#39;t extremely spicy where you&#39;ll have to down yourself down with water. It was just right, that you&#39;ll be able to taste the flavors. <br><br>Presentation on ALL the dishes was 100X prettier than the sushi places around here and around Geary Blvd!<br><br>Wanted to try the oyster shot, but they were out. BUMMER... But I will definitely be back for more!",
