"rating":"4.0",
"reviewcomment":"Saha is at the top of my list of go-to restaurants in the Bay Area. I had one of the most delicious meals I&#39;ve ever had there!<br><br>My wife and I went to Saha in October. The bus ride and walk to the restaurant were a little sketchy (not in the best neighborhood), but it&#39;s well worth the meal. We had to wait a few minutes but were seated and taken care of by a wonderful waiter. He was very attentive to us (and my wife&#39;s vegan and gluten-free diet) and helped us choose the best dishes. We definitely splurged and ordered more than we needed: a few small plates and a few large plates. The hummus and pita (even the gluten-free pita) is out of this world! The roasted cauliflower and falafel were so good, and our main dishes were very tasty. I would&#39;ve loved to have had some dessert but we just didn&#39;t have enough room.<br><br>Though we had all vegetarian dishes, there were plenty of meat options as well, which is why we will definitely be coming back here when we have visitors in town!",
