"reviewcomment":"One thing that I don&#39;t people have mentioned here is that this place is an awesome place to drink. Unlike many taquerias, they have a full bar, and Bulleit was just $6 per (large) glass. We also had Patron and Don Julio Anejo for $9 per shot, which is pretty good for SF.<br><br>The ceviche was excellent, and it was served almost like nachos. They do a great job with the salsa and had the right ratio of tomatoes to onions to cilantro. I don&#39;t remember the name, but they have a chicken super nachos that might be the best I&#39;ve had.<br><br>The staff was super welcoming and accommodating - even though we had finished our food and were just enjoying the bar, they gave us some chips and nachos, they set up extra tables for us, and we even got to enjoy a mariachi band iwth a blue violin.",
