"reviewcomment":"We managed to walk up and get a cozy spot on a bar. Which was great since we kind of bumbled over after a day in the park. <br><br>The food was really fantastic. If you can get over there before the menu gets changed I would highly suggest ordering the Ricotta Cavatelli. Great news as you can order half orders of the pasta!! So you can try a couple if you&#39;d like. The Cavatelli was delicious. Probably my favorite of the night even though the Sea Bass was amazing. But pasta just always hits for me. The Sea Bass I finished so quickly my date was astonished as was I. I meant to offer him a bite but next thing I knew it was gone. Ooops. He ordered half orders of the spaghetti, cavatelli, and steak &amp; fries. Plates were cleaned.<br><br>For dessert I got the Young Ginger Pavlova which was bonkers. If you are a fan of meringues and coconut I highly recommend it.<br><br>I&#39;ll certainly come back.",
