"rating":"4.0",
"reviewcomment":"Now, 5 stars, that&#39;s a first for me at a restaurant.   More accurately, I would give it a 4.8 instead.  But it&#39;s hard to argue with 5...<br><br>The thinnest crust I&#39;ve had outside my favorite Greenwich Village pizza place.  But you need to wait 5 min.  Maybe 8 before you eat the Za.  The flavors intensify with time.  The temperature equalizes throughout and all those hidden flavors start to come out.  Oh, that heat transfer process is doing more than just transferring heat.  Maybe, just maybe it&#39;s thermodynamics at work because it&#39;s my new favorite pizza in SF.  All that entropy carries out into the atmosphere.  Just fantastic!!  But beware there are just about 12 tables, and they fill up quickly.  No reservations.  <br>The wine (Nero d&#39;Avola, Piedmonte 2010) was also fantastic and a perfect match for my Italian sausage pizza.  <br>I&#39;m definitely coming back. <br><br>Oh, yeah, very cool and super attentive servers.  Just great people all around.",
