"rating":"4.5",
"reviewcomment":"I was very impressed by the service and food of Mission Public. Albeit the name is a little confusing, and doesn&#39;t really indicate that it is a coffee shop, cafe, and bar. After telling the server that it was my birthday, he immediately went and filled up a glass of their finest beer, and insisted that this one was on them. Anthony was as pleasant as can be and made me feel right at home.<br><br>Still, the food was just as great as the friendliness. I had a delicious upper deck sandwich, which was accompanied by a tasty side salad. I was very impressed by how fast the service is, and how they created a sandwich this good and this beautiful so quickly.<br><br>Finally, the ambience of the cafe is the perfect harmony of its three functions; as a cafe, coffee shop, and bar. Light music, wifi, well lit interior, and awesome seating. I highly recommend this place. I came here as my only meal in San Francisco, and I am pleasantly surprised.<br><br>This place has a ton of character, and is executed very well. You&#39;d do well to stop by, if even just for a drink. Mission Public is fantastic.",
