"reviewcomment":"Hidden in an alley, yet gets pretty packed for lunch! Buckwheat and gluten free crepes? A galette is a form of crêpe made with buckwheat flour, it is an open-faced crepe. Galette is located in an alleyway off Kearny. It&#39;s only open for lunch so get there early, take a whiff while you wait and eat the heavenly little love on your plate. It&#39;s already one of the more pleasant FiDi lunch options (with just-added dinner, Wed.-Fri.): casual, order-at-the-counter ease. The space is minimalist reminds me of a restaurant in The Village in New York, very simple yet quaint.<br><br>Ordered the number #8  the Brie-hugger  because I love brie it was so tasty and since the gallete is so thin I was expecting it to be very light but it was very filling.   The salad was very tangy and refreshing. <br><br>Also got the special that day the Roasted Beet Salad also a very generous serving.  Delicious! Was too stuffed to even try the dessert galette but there is always a next time! Five stars that is how happy I was with my lunch!",
