"rating":"4.5",
"reviewcomment":"Sooo good. Went on a coworker&#39;s recommendation. He said get the egg-salad sandwich. I NEVER get the egg-salad sandwich anywhere, but I am glad I followed his advice. It was made of huge pieces of boiled egg, lightly spiced and not too mayonnaise-y. Super fresh and delicious. Also huge. <br><br>AND they offer gluten-free bread. I am one of those annoying gluten-intolerant people, so it makes me really, really happy when I can get a big ole sandwich just like everybody else. Another plus: the gluten-free roll they use is as big (or close to as big) as the regular rolls, so you don&#39;t get skimped on the size of your sandwich. You gluten-free people out there know the tiny 3-inches-across thing most sandwich shops give you when you order gluten-free bread. For me, Tony&#39;s sandwich was two full meals.<br><br>UPDATE: I went back for lunch today. The guy at the cash register was super-nice and the tuna sandwich I had was stellar.  Fresh and yummy. I&#39;d add a star if I could.",
