"rating":"4.0",
"reviewcomment":"Romina makes us feel welcome here! We are a lesbian couple, one Italian, one Jewish. I enjoy taking my date here for authentic pizzas in the style of Roma, brings me back to my vacation time in Rome. I also like the authentic Italian owner&#39;s sense of hospitality and warmth which makes me feel welcome. Her accent is also charming!  Must add to the flavor of the food :)There is always some great house wines and Romina makes suggestions on what goes with what if you don&#39;t know any better. She&#39;s also treated us to some amazing desserts (lemon curd tart, volcano brownie. The &#34;Di Pera&#34; Pear Salad is just perfect, fresh, tart, and sweet.<br><br>If you&#39;ve ever been to Rome or Italy, this is the place to go for &#34;legit&#34; Roman food with a cute little hole in the wall romantic feel. Avoid the crowds of North Beach and head to Cinecitta!",
