"reviewcomment":"Knowing I was making a trip out to San Francisco, I felt compelled to have some kind of food agenda. My source for Nopa suggested to do brunch and book a reservation whatever time of day I actually decided to come. <br><br>My source was right: this place is constantly busy and with good reason. The food is out of this world and the service is impeccable. I don&#39;t think I&#39;ve ever encountered a well-informed staff since my restaurant trip in Las Vegas to Twist. I ended up coming here for dinner and I believe I had the sea bass (I honestly forgot which fish it was) and it was absolutely delicious. I never knew you could cut orange peels into a meal and eat them, let alone enjoy eating them! Mind blown for sure. <br><br>For dessert, I tried the dark chocolate tart with goat cheese ice cream. At first me and my friend were like, &#34;um, why goat cheese ice cream?!?&#34; As soon as we got our order, our tone changed to &#34;holy crap, GOAT CHEESE ICE CREAM!!&#34; Needless to say, our adventure to Nopa was ACA-MAZING!!! <br><br>I&#39;m now on the hunt for more wonderous goat cheese ice cream. Thanks Nopa.",
